import React, { createRef, useState } from 'react';
import jsPDF from 'jspdf';
import htmlToImage from 'html-to-image';

import ContainerItem from '../../reusables/ContainerItem';
import Button from '../../reusables/Button';

import './opps.css'
import oxxobrand from '../../../assets/oxxopay_brand.png'

function OxxoOrder({ oxxoOrder }) {
  const { charges = {} } = oxxoOrder;
  const { data = [{}] } = charges;
  const amount = `${data[0].amount}`;
  const [downloadMessagd, setMessage] = useState(null);

  const ref = createRef();

  const handleSave = () => {
    setMessage('La descarga iniciara en un momento.');
    const img = 'data:image/png;base64,'
    const doc = new jsPDF({
      format: [612, 792],
      unit: 'cm',
    });
    const w = doc.internal.pageSize.getWidth();
    const h = doc.internal.pageSize.getHeight();
    doc.addImage(img, 'PNG', (w - 13.36145665)/2, (h - 13.30853999)/2);
    doc.setFontSize(18);
    doc.setFont('Helvetica');

    const am = `${Intl.NumberFormat(
      'es-MX', { style: 'currency', currency: 'MXN' }
    ).format(amount.substring(0, amount.length - 2) + '.' + amount.substring(amount.length - 2))} MXN`
    doc.text(w/2 + 1.5, h/2 - 3.5, am, null, null, 'center')
    doc.text(w/2, h/2, data[0].payment_method.reference, null, null, 'center')
    doc.save(`${oxxoOrder.id}.pdf`);
  };

  return (
    <div className="dashboard-container">
      <ContainerItem className="dash-item-center">
        <div
          ref={ref}
          style={{ display: 'flex', justifyContent: 'center', width: '100%' }}>
          <div class="opps">
            <div class="opps-header">
              <div class="opps-reminder">Ficha digital. No es necesario imprimir.</div>
                <div class="opps-info">
                  <div class="opps-brand"><img src={oxxobrand} alt="OXXOPay" /></div>
                  <div class="opps-ammount">
                    <h3>Monto a pagar</h3>
                    <h2 style={{ minHeight: '30px' }}>
                      { Intl.NumberFormat(
                          'es-MX', { style: 'currency', currency: 'MXN' }
                        ).format(amount.substring(0, amount.length - 2) + '.' + amount.substring(amount.length - 2)) }
                      <sup>MXN</sup>
                    </h2>
                    <p>OXXO cobrar una comisin adicional al momento de realizar el pago.</p>
                  </div>
                </div>
                <div class="opps-reference" style={{ display: 'flex', flexFlow: 'column', alignItems: 'center' }}>
                  <h3>Referencia</h3>
                  <h1 style={{ minHeight: '20px' }}>{ data[0].payment_method.reference  }</h1>
                </div>
                {/* <div style={{ textAlign: 'center' }}>
                  <img src={ data[0].payment_method.barcode_url } />
                </div> */}
              </div>
              <div class="opps-instructions">
                <h3>Instrucciones</h3>
                <ol>
                  <li>Acude a la tienda OXXO ms cercana. <a href="https://www.google.com.mx/maps/search/oxxo/" target="_blank">Encuntrala aqu</a>.</li>
                  <li>Indica en caja que quieres realizar un pago de <strong>OXXOPay</strong>.</li>
                  <li>Dicta al cajero el nmero de referencia en esta ficha para que tecle directamete en la pantalla de venta.</li>
                  <li>Realiza el pago correspondiente con dinero en efectivo.</li>
                  <li>Al confirmar tu pago, el cajero te entregar un comprobante impreso. <strong>En el podrs verificar que se haya realizado correctamente.</strong> Conserva este comprobante de pago.</li>
                </ol>
              </div>
            </div>
          </div>
          {
            downloadMessagd && (
              <div style={{ textAlign: 'center' }}>
                { downloadMessagd }
              </div>
            )
          }
          <div style={{ textAlign: 'center' }}>
            <Button marginTop="0px" width="100%" htmlType="button" onClick={handleSave}>
              Descargar
            </Button>
          </div>
      </ContainerItem>
    </div>
  );
}

export default OxxoOrder;
